@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("eventbrite.com.au") {


#contentpub, #global-header, html
{
background: #000000 !important;
}
#ticketInfo, #TicketReg, #OrderReg,
#ticket_table td, #track_event_container,
.panel_head2, .panel_section, .panel_body
{
background: #222222 !important;
}
h1, h2, h3, h4, h5, h6,
.summary, a, td, .panel_head2, 
.panel_section, .panel_body
{
color: #FFFFFF !important;
}
}
